-- Volcando estructura para procedimiento inet.get_voucher_dte
DROP PROCEDURE IF EXISTS `get_voucher_dte`;
DELIMITER //
CREATE PROCEDURE `get_voucher_dte`(
    IN idDte INT,
    IN numDoc INT,
    IN companyId INT,
    IN codTransaction VARCHAR(2),
    IN typedoc VARCHAR(4)
)
BEGIN
    DECLARE TotGra DECIMAL(12, 2);
    DECLARE TotExe DECIMAL(12, 2);
    DECLARE TotNos DECIMAL(12, 2);
    DECLARE TotIva DECIMAL(12, 2);
    DECLARE nuDocRelacionado VARCHAR(50);
    DECLARE NuDocFrom INT;
    DECLARE tipoDteOriginal VARCHAR(4);
    DECLARE codigoGeneracionOriginal VARCHAR(50);
    DECLARE selloRecibidoOriginal VARCHAR(50);
    DECLARE fhRecibidoOriginal DATETIME;
    DECLARE docEntryRef1 INT;
    DECLARE idDteOriginal INT;
    DECLARE referencia1 VARCHAR(50);
    DECLARE IdCliente VARCHAR(6);
    DECLARE nombreContacto VARCHAR(100) DEFAULT '';
    DECLARE emailContacto VARCHAR(100) DEFAULT '';
    DECLARE tipoItem VARCHAR(2) DEFAULT '2';
    DECLARE uniMedida VARCHAR(4) DEFAULT '59';
    DECLARE codTributo VARCHAR(30) DEFAULT NULL;
    DECLARE tributos VARCHAR(10) DEFAULT 'C3';
    DECLARE tipo_doc VARCHAR(3) DEFAULT 'FAC';

    SELECT a.client_id AS IdCliente, b.codemh AS tipo_doc
    INTO IdCliente, tipo_doc
    FROM sales a
    INNER JOIN typedocuments b ON b.id = a.typedocument_id
    WHERE a.company_id = companyId AND a.id = numDoc;

    CASE tipo_doc
        WHEN 'FAC' THEN SET tributos = NULL;
        WHEN 'CRF' THEN SET tributos = '20';
        WHEN 'NCR' THEN SET tributos = '20';
        WHEN 'FEX' THEN SET tributos = 'C3';
    END CASE;
    
    -- Datos de Empresa en espera

    IF codTransaction = '01' THEN
   
        SELECT 
            'Encabezado' AS NmTabla,
            s.id AS num_fac,
            CASE c.tpersona
                WHEN 'N' THEN CONCAT(c.firstname, ' ', c.secondname, ' ', c.firstlastname, ' ', c.secondlastname)
                WHEN 'J' THEN c.comercial_name
            END AS nameClient,
            t.description AS name_document,
            d.versionJson AS version_Json,
            DATE_FORMAT(s.date, '%Y-%m-%d') AS dateDocument,
            DATE_FORMAT(s.created_at, '%H:%i:%s') AS hourDocument,
            t.codemh AS cod_type_document,
            REPLACE(c.nit, '-', '') AS nit_emisor,
            REPLACE(c.ncr, '-', '') AS ncr_emisor,
            CASE
                	WHEN IFNULL(c.nit, '') <> '' THEN '36' 
               	-- WHEN ISNULL(c.dui, '') <> '' THEN '13' 
                  -- WHEN ISNULL(c.dui, '') <> '' THEN '03' 
            END AS type_document,
            c.nit AS num_document,
            co.tipoEstablecimiento AS tipoEstablecimiento,
            co.name AS name_company,
            eco.code AS code_activity,
            eco.name AS descrip_activity,
            co.name AS name_comercial,
            depa.code ASdepartamento_emisor,
            muni.code AS municipio_emisor,
            ad.reference AS complemento_emisor,
            pais.code AS codPais_emisor,
            pais.name AS namePais_emisor,
            REPLACE(ph.phone, '-', '') AS tel_emisor,
            co.email AS correo_emisor,
            NULL AS codEstableMH,
            NULL AS codEstable,
            NULL AS codPuntoVentaMH,
            NULL AS codPuntoVenta,
            REPLACE(LTRIM(RTRIM(c.nit)), '-', '') AS nit_receptor,
            REPLACE(LTRIM(RTRIM(c.ncr)), '-', '') AS ncr_receptor,
            ecoc.code AS code_activity_receptor,
            ecoc.name AS descrip_activity_receptor,
            c.comercial_name AS name_comercial_receptor,
            depac.code AS departamento_receptor,
            munic.code AS municipio_receptor,
            adc.reference AS complemento_receptor,
            paisc.code AS codPais_receptor,
            paisc.name AS namePais_receptor,
            REPLACE(phc.phone, '-', '') AS tel_receptor,
            c.email AS correo_receptor,
            NULL AS total_letras,
            CAST(IFNULL(SUM(sd.nosujeta), 0.00) AS DECIMAL(10, 2)) AS tot_nosujeto,
            CAST(IFNULL(SUM(sd.exempt), 0.00) AS DECIMAL(10, 2)) AS tot_exento,
            CAST(IFNULL(SUM(sd.pricesale), 0.00) AS DECIMAL(10, 2)) AS tot_gravado,
            CAST(IFNULL(SUM(sd.nosujeta), 0.00) + IFNULL(SUM(sd.exempt), 0.00) + IFNULL(SUM(sd.pricesale), 0.00) AS DECIMAL(18, 2)) AS subTotalVentas,
            0.00 AS descuNoSuj,
            0.00 AS descuExenta,
            0.00 AS descuGravada,
            0.00 AS porcentajeDescuento,
            0.00 AS totalDescu,
            0.00 AS otrosTributos,
            CAST(IFNULL(SUM(sd.nosujeta), 0.00) + IFNULL(SUM(sd.exempt), 0.00) + IFNULL(SUM(sd.pricesale), 0.00) AS DECIMAL(18, 2)) AS subTotal,
            0.00 AS ivaPerci1,
            SUM(sd.detained) AS ivaRete1,
            0.00 AS reteRenta,
            s.totalamount,
            0.00 AS totalNoGravado,
            s.totalamount AS aPagar,
            s.waytopay AS condicionOperacion,
            0.00 AS saldoFavor,
            s.totalamount AS contado,
            0.00 AS credito,
            0.00 AS tarjeta,
            NULL AS periodo,
            u.name AS nombEntrega,
            NULL AS docuEntrega,
            CASE c.tpersona
                WHEN 'N' THEN CONCAT(c.firstname, ' ', c.secondname, ' ', c.firstlastname, ' ', c.secondlastname)
                WHEN 'J' THEN c.legal
            END AS nombRecibe,
            c.nit AS docuRecibe,
            NULL AS observaciones,
            NULL AS placaVehiculo,
            NULL AS apendice_campo,
            NULL AS apendice_etiqueta,
            NULL AS apendice_valor,
            CAST(SUM(sd.detained13) AS DECIMAL(18, 2)) AS total_iva,
            u.id AS id_vendedor,
            c.id AS id_cliente,
            NULL AS referencia_tarjeta,
            d.codigoGeneracion AS codigoGeneracion,
            d.selloRecibido AS selloRecibido,
            d.fhRecibido AS fhRecibido
        FROM sales s
        INNER JOIN salesdetails sd ON s.id = sd.sale_id
        INNER JOIN typedocuments t ON s.typedocument_id = t.id
        INNER JOIN companies co ON s.company_id = co.id
        INNER JOIN economicactivities eco ON co.economicactivity_id = eco.id
        INNER JOIN addresses ad ON co.address_id = ad.id
        INNER JOIN countries pais ON ad.country_id = pais.id
        INNER JOIN departments depa ON ad.department_id = depa.id
        INNER JOIN municipalities muni ON ad.municipality_id = muni.id
        INNER JOIN phones ph ON co.phone_id = ph.id
        INNER JOIN clients c ON s.client_id = c.id
        INNER JOIN economicactivities ecoc ON c.economicactivity_id = ecoc.id
        INNER JOIN addresses adc ON c.address_id = adc.id
        INNER JOIN countries paisc ON adc.country_id = paisc.id
        INNER JOIN departments depac ON adc.department_id = depac.id
        INNER JOIN municipalities munic ON adc.municipality_id = munic.id
        INNER JOIN phones phc ON c.phone_id = phc.id
        INNER JOIN users u ON s.user_id = u.id
        INNER JOIN dte d ON d.company_id = companyId AND d.id = idDte
        WHERE s.id = numDoc AND s.company_id = companyId;
        
        -- Detalle del credito fiscal
        -- IF typedoc = 'NCR' THEN
        
        -- END IF;
        
        -- Detalle de la Factura
        IF typedoc <> 'NCR' THEN
        
	        SELECT  
			  		'Detalle' NmTabla,
			  		s.company_id,
			  		s.id corr,
			  		sd.amountp cantidad,
			  		sd.product_id,
			  		prod.name descripcion_producto,
			  		CAST(sd.priceunit AS DECIMAL(18, 2)) AS price_unit,
			  		CAST(sd.exempt AS DECIMAL(18, 2)) AS excento,
			  		CAST(sd.pricesale AS DECIMAL(18, 2)) AS gravado,
				  	CAST(sd.detained13 AS DECIMAL(18, 2)) AS iva_fac,
			  		CAST(s.totalamount AS DECIMAL(18, 2)) AS total,
			  		prod.provider_id id_proveedor,
			  		IFNULL(sd.nosujeta, 0.00) no_sujetas,
			  		tipoItem tipoItem,
	       		uniMedida uniMedida,
	       		codTributo codTributo,
	       		CASE WHEN sd.pricesale <> 0
	       		THEN tipo_doc ELSE NULL END tributos
			  FROM sales s
	        INNER JOIN salesdetails sd ON s.id=sd.sale_id
	        INNER JOIN products prod ON sd.product_id=prod.id
	        WHERE s.id=numDoc AND s.company_id=companyId;
        
        END IF;
        
    END IF;
    
END//
DELIMITER ;

