-- Volcando estructura para procedimiento inet.sp_sele_dte_contingencia
DROP PROCEDURE IF EXISTS `sp_sele_dte_contingencia`;
DELIMITER //
CREATE PROCEDURE `sp_sele_dte_contingencia`(
    IN p_IdEmpresa SMALLINT,
    IN p_Id INT
)
BEGIN
    -- Datos de Empresa
    SELECT 
        'Empresa' AS NmTabla,
        a.company_id AS id_empresa,
        REPLACE(c.nit, '-', '') AS nit,
        a.passPrivateKey AS passwordPri,
        a.passMH AS pwd,
        c.email,
        a.ambiente,
        b.url_credencial,
        b.url_envio,
        b.url_invalidacion,
        b.url_contingencia
    FROM config a
    LEFT OUTER JOIN ambientes b ON a.ambiente=b.id
    LEFT OUTER JOIN companies c ON a.company_id = c.id
    WHERE a.company_id = p_IdEmpresa;

    -- Encabezado
    SELECT 
        'Encabezado' AS NmTabla,
        a.versionJson AS versionJson,
        a.ambiente,
        a.codigoGeneracion,
        a.fechaCreacion,
        TIME(NOW()) AS horaCreacion,
        REPLACE(b.nit, '-', '') AS nit_emisor,
        b.name AS nombre_empresa,
        a.nombreResponsable,
        a.tipoDocResponsable,
        a.nuDocResponsable,
        b.tipoEstablecimiento,
        NULL AS codigo_establecimiento,
        NULL AS codigo_punto_venta,
        REPLACE(c.phone, '-', '') AS telefono_emisor,
        b.email AS correo,
        a.fInicio,
        a.fFin,
        a.hInicio,
        a.hFin,
        a.tipoContingencia,
        a.motivoContingencia,
        a.selloRecibido
    FROM contingencias a
    LEFT JOIN companies b ON a.idEmpresa = b.id
    INNER JOIN phones c ON b.phone_id = c.id
    WHERE a.idEmpresa = p_IdEmpresa AND a.id = p_Id;

    -- Detalle
    SELECT 
        'Detalle' AS NmTabla,
        1 NuItems,
        c.codemh tipoDte,
        NULL as codigoGeneracion
    FROM sales a
    INNER JOIN contingencias b ON a.id_contingencia = b.id
    INNER JOIN typedocuments c ON a.typedocument_id = c.id
    WHERE b.id = 10 AND a.company_id = 1;
    
END//
DELIMITER ;

